Actions without children usually execute some behavior then return a RunResult::Success or a RunResult::Failure. An action is a bevy component struct with an associated system. Currently all actions must implement Default, Clone, Component, serde::Serialize, serde::Deserialize. #[action(system=print_action)]
#[derive(Default)]
pub struct PrintAction(pub value: String); fn print_action(mut commands: Commands, query: Query<(Entity,&PrintAction), With<Running>){ for (entity, action) in query.iter(){ println!("Print Action: {}", action.0); commands.entity(entity).insert(RunResult::Success); }
}

