To solve the problem of, say every scoring system wanting a Query<&mut Score> which would break parallelism, each action has a distinct component, and fields marked as #[shared] will be copied at the end of each tick when they change. The below action will add a Score component to this entity and update it whenever the ScoringAction changes. #[action(system=scoring_action)]
pub struct ScoringAction{ #[shared] pub score: Score
}; Now we can have a utility selector that immutably queries the Score component of its children, allowing for full parallelism.
